import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import ArmorTypePage from './ArmorTypePage';
import CaryllRunesPage from './CaryllRunesPage';
import HunterToolsPage from './HunterToolsPage';
import WeaponTypePage from './WeaponTypePage';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Bloodborne Wiki</h1>
        </header>
        <div className="content">
          <div className="links">
            <Link to="/armor">Armor</Link>
            <Link to="/caryll-runes">Caryll Runes</Link>
            <Link to="/hunter-tools">Hunter Tools</Link>
            <Link to="/weapons">Weapons</Link>
          </div>
        </div>
        <Route path="/armor" component={ArmorTypePage} />
        <Route path="/caryll-runes" component={CaryllRunesPage} />
        <Route path="/hunter-tools" component={HunterToolsPage} />
        <Route path="/weapons" component={WeaponTypePage} />
      </div>
    </Router>
  );
}

export default App;
